import React from "react";
import { Card } from "antd";

export default (props: {
  node: {
    id: string;
    types: string[];
    name: string;
  };
}) => {
  return (
    <Card title={props.node.name}>
      <div>Number #{parseInt(props.node.id, 10)}</div>
      <ul>
        {props.node.types.map((el) => {
          return <li style={{ textAlign: "left" }}>{el}</li>;
        })}
      </ul>
    </Card>
  );
};
